import React from "react";
import "../Layout.css";
// Importera Font Awesome ikoner
import { FaFacebook, FaInstagram } from "react-icons/fa";

function Contact() {
  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>Kontakta oss</h1>

        <div className="inner-card">
          <p style={{ fontWeight: 600, wordWrap: "break-word", overflowWrap: "break-word", marginBottom: "12px" }}>
            Du kan kontakta oss via nedanst√•ende alternativ:
          </p>
          <ul style={{ fontWeight: 600, wordWrap: "break-word", overflowWrap: "break-word", marginBottom: "12px" }}>
            <li style={{ marginBottom: "8px" }}>E-post: <a href="mailto:exempel@kumlasportfiske.se">exempel@kumlasportfiske.se</a></li>
            <li style={{ marginBottom: "8px" }}>Telefon: 012-3456789</li>
            <li style={{ marginBottom: "8px" }}>Adress: Kommer snart, Kumla</li>
            <li style={{ marginBottom: "8px" }}>
              <li>Facebook:<a href="https://www.facebook.com/kumlasportfiske" target="_blank" rel="noopener noreferrer" style={{ marginRight: "16px", fontSize: "24px", color: "#1877F2" }}>
                <FaFacebook />
              </a></li>
              <a href="https://www.instagram.com/kumlasportfiske/" target="_blank" rel="noopener noreferrer" style={{ fontSize: "24px", color: "#C13584" }}>
                <FaInstagram />
              </a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Contact;
